=head1 DESCRIPTION

Encloses data related to a successful message in a batch request for
topic.

=head1 ATTRIBUTES


=head2 Id => Str

The C<Id> of an entry in a batch request.


=head2 MessageId => Str

An identifier for the message.


=head2 SequenceNumber => Str

This parameter applies only to FIFO (first-in-first-out) topics.

The large, non-consecutive number that Amazon SNS assigns to each
message.

The length of C<SequenceNumber> is 128 bits. C<SequenceNumber>
continues to increase for a particular C<MessageGroupId>.



